// 新品上线设置的接口
import http from "./http";

//获取新品上线列表信息
const queryProductList = (pageNumber = 1, pageSize = 10, configType = 4) => {
    return http.get('/indexConfigs', {
        params: {
            pageNumber,
            pageSize,
            configType
        }
    })
}



//获取为你推荐列表信息


export default {
    queryProductList
}
